/*
 * @Descripttion: 
 * @Author: 
 * @Date: 2021-04-11 10:36:53
 * @LastEditors: Wei
 * @LastEditTime: 2021-04-18 21:13:20
 * @FilePath: \react-typescript\src\App.tsx
 */
import React, { FC } from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import Connect from "./pages/SensorsOnRobot/Connect";
import Model from './pages/SensorsOnRobot/Model';
import { RouterList } from './router/SensorsOnRobot'
const App: FC = () => {
    return (
        <div>
            <Router>
                <div>
                    <nav>
                        <ul>
                            <li>
                                <Link to="/connect">Connect</Link>
                            </li>
                            <li>
                                <Link to="/model">Model</Link>
                            </li>
                        </ul>
                    </nav>
                </div>

                <div>
                    <Switch>
                        {
                            RouterList.map((item, index) => {
                                return <Route path={item.path} component={item.component} />
                            })

                        }
                    </Switch>
                </div>
            </Router>
        </div>
    )
}

export default App;
